import React from 'react'
import './navbar.css'

export default function NavBar() {
    return (
        <div>
            <div className="top">
               <div className="topLeft"><i class="fa fa-facebook-square"></i></div>
               <div className="topCenter">center</div>
               <div className="topRight">right</div>
            </div>
        </div>
    )
}
